// src/modules/trafficEstimation/dataImportExport.js

/**
 * Parse CSV/TSV text into array of row objects
 * Expected columns: Year, Gasoline, Diesel, BusSmall, BusLarge, TruckSmall, TruckMedium, TruckLarge, Special
 */
export function parseCSV(text) {
  const lines = text.trim().split('\n');
  if (lines.length < 2) {
    throw new Error('File must have at least a header row and one data row');
  }

  // Parse header
  const header = lines[0].split(/[,\t]/);
  
  // Parse data rows
  const data = [];
  for (let i = 1; i < lines.length; i++) {
    const values = lines[i].split(/[,\t]/);
    if (values.length < 9) continue; // Skip incomplete rows
    
    const row = {
      year: parseInt(values[0]) || 0,
      passengerGasoline: parseFloat(values[1]) || 0,
      passengerDiesel: parseFloat(values[2]) || 0,
      busSmall: parseFloat(values[3]) || 0,
      busLarge: parseFloat(values[4]) || 0,
      truckSmall: parseFloat(values[5]) || 0,
      truckMedium: parseFloat(values[6]) || 0,
      truckLarge: parseFloat(values[7]) || 0,
      truckSpecial: parseFloat(values[8]) || 0
    };
    data.push(row);
  }
  
  return data;
}

/**
 * Read file as text
 */
export function readFileAsText(file) {
  return new Promise((resolve, reject) => {
    const reader = new FileReader();
    reader.onload = (e) => resolve(e.target.result);
    reader.onerror = (e) => reject(e);
    reader.readAsText(file);
  });
}

/**
 * Export data to CSV format
 * data: array of { year, direction, passengerGasoline, ..., totalAadt, heavyVehicleMixPt }
 */
export function exportToCSV(data, direction) {
  const headers = [
    'Year',
    'Direction',
    'Gasoline',
    'Diesel',
    'Bus Small',
    'Bus Large',
    'Truck Small',
    'Truck Medium',
    'Truck Large',
    'Special',
    'Total AADT',
    'Heavy Mix Pt (%)'
  ];
  
  const rows = data.map(row => [
    row.year,
    direction,
    row.passengerGasoline,
    row.passengerDiesel,
    row.busSmall,
    row.busLarge,
    row.truckSmall,
    row.truckMedium,
    row.truckLarge,
    row.truckSpecial,
    row.totalAadt || '',
    row.heavyVehicleMixPt != null ? row.heavyVehicleMixPt.toFixed(2) : ''
  ]);
  
  const csvContent = [
    headers.join(','),
    ...rows.map(row => row.join(','))
  ].join('\n');
  
  return csvContent;
}

/**
 * Trigger download of CSV file
 */
export function downloadCSV(csvContent, filename = 'traffic_estimation.csv') {
  const blob = new Blob([csvContent], { type: 'text/csv;charset=utf-8;' });
  const link = document.createElement('a');
  const url = URL.createObjectURL(blob);
  
  link.setAttribute('href', url);
  link.setAttribute('download', filename);
  link.style.visibility = 'hidden';
  document.body.appendChild(link);
  link.click();
  document.body.removeChild(link);
}

/**
 * Export data to PDF format
 * Uses dynamic import to load jsPDF and autoTable only when needed
 */
export async function exportToPDF(data, title = 'Traffic Estimation Results') {
  try {
    // Dynamic imports for PDF generation libraries
    const { jsPDF } = await import('jspdf');
    await import('jspdf-autotable');
    
    const doc = new jsPDF();
    
    // Add title
    doc.setFontSize(16);
    doc.text(title, 14, 15);
    
    // Add generation timestamp
    doc.setFontSize(10);
    doc.text(`Generated: ${new Date().toLocaleString()}`, 14, 22);
    
    // Prepare table data
    const headers = [
      ['Year', 'Gasoline', 'Diesel', 'Bus\nSmall', 'Bus\nLarge', 'Truck\nSmall', 'Truck\nMedium', 'Truck\nLarge', 'Special', 'Total\nAADT', 'Pt (%)']
    ];
    
    const rows = data.map(row => [
      row.year,
      row.passengerGasoline?.toLocaleString() || 0,
      row.passengerDiesel?.toLocaleString() || 0,
      row.busSmall?.toLocaleString() || 0,
      row.busLarge?.toLocaleString() || 0,
      row.truckSmall?.toLocaleString() || 0,
      row.truckMedium?.toLocaleString() || 0,
      row.truckLarge?.toLocaleString() || 0,
      row.truckSpecial?.toLocaleString() || 0,
      row.totalAadt?.toLocaleString() || '',
      row.heavyVehicleMixPt != null ? row.heavyVehicleMixPt.toFixed(2) : ''
    ]);
    
    // Generate table
    doc.autoTable({
      head: headers,
      body: rows,
      startY: 28,
      styles: { fontSize: 8, cellPadding: 2 },
      headStyles: { fillColor: [66, 139, 202], textColor: 255 },
      alternateRowStyles: { fillColor: [245, 245, 245] },
      columnStyles: {
        0: { cellWidth: 15 },  // Year
        9: { cellWidth: 20 },  // Total AADT
        10: { cellWidth: 15 }  // Pt
      }
    });
    
    // Save the PDF
    doc.save(`traffic_estimation_${Date.now()}.pdf`);
    return true;
  } catch (error) {
    console.error('PDF export error:', error);
    throw new Error('Failed to generate PDF. Please try CSV export instead.');
  }
}
